import React from 'react'
import Precedent from '../components/Precedent'
import CardRend from '../components/CardRend'

function Rendezvous() {
  return (
    <div className='parentCards'>
      <Precedent />
      <CardRend />
    </div>
  )
}

export default Rendezvous
